import java.util.Arrays;
import java.util.Random;

// Press Shift twice to open the Search Everywhere dialog and type `show whitespaces`,
// then press Enter. You can now see whitespace characters in your code.
public class Main {
    public static void main(String[] args) {
        System.out.println(duplicateChars("orange"));
        System.out.println(getInitials("Barack Obama"));
        System.out.println(differenceEvenOdd(new int[] {22, 50, 16, 63, 31, 55}));
        System.out.println(equalToAvg(new int[] {1, 2, 3, 4, 6}));
        System.out.println((Arrays.toString(indexMult(new int[] {3, 3, -2, 408, 3, 31}))));
        System.out.println(reverse("The quick brown fox."));
        System.out.println(Tribonacci(7));
        System.out.println(pseudoHash(10));
        System.out.println(botHelper("Two pepperoni pizzas please"));
        System.out.println(isAnagram("hello", "world"));
    }

    public static boolean duplicateChars(String string) {
        string = string.toLowerCase();
        char firstLetter = string.charAt(0);
        for (int i = 1; i < string.length(); i++) {
            if (firstLetter == string.charAt(i)) {
                return true;
            }
        }
        return false;
    }

    public static String getInitials(String string) {
        String [] strings = string.split(" ");
        return  ""+strings[0].charAt(0)+strings[1].charAt(0);
    }

    public static int differenceEvenOdd(int[] values) {
        int answer = 0;
        for (int i = 0; i < values.length; i++) {
            answer += (int) (values[i] * Math.pow(-1,i));
        }
        return answer;
    }

    public static boolean equalToAvg(int[] values) {
        int sum = 0;
        for (int element : values)
            sum += element;
        float average = (float) sum / values.length;
        for (int element : values) {
            if (element == average) {
                return true;
            }
        }
        return false;

    }

    public static int[] indexMult(int[] values) {
        int[] new_values = new int[values.length];

        for (int i = 0; i < values.length; i++) {
            new_values[i] = values[i] * i;
        }
        return new_values;
    }

    public static  String reverse(String string) {
        String s = "";

        for (int i=string.length()-1; i>=0; i--)
        {
            s += string.charAt(i);
        }
        return s;
    }
    public static int Tribonacci(int x) {
        if (x == 0)
            return 0;
        else if (x == 1)
            return 0;
        else if (x == 2)
            return 1;
        else
            return Tribonacci(x-1) + Tribonacci(x -2) + Tribonacci(x-3);
    }
    public static String pseudoHash(int x) {
        Random rand = new Random();
        String str = "abcdef0123456789";
        String hash = "";
        for (int i = 0; i < x; i++) {
            int rand_int = rand.nextInt(str.length());
            hash += str.charAt(rand_int);
        }
        return hash;
    }
    public static String botHelper(String str) {
        return str.contains("help") ? "Calling for a staff member" : "Keep waiting";
    }
    public static boolean isAnagram(String str1, String str2) {
        char[] arr1 = str1.toCharArray();
        char[] arr2 = str2.toCharArray();
        Arrays.sort(arr1);
        Arrays.sort(arr2);
        return Arrays.equals(arr1,arr2);
    }
}

import React, { useEffect, useMemo, useRef } from 'react';
import {
  Button,
  Checkbox,
  FormControl,
  FormErrorMessage,
  FormLabel,
  Input,
  InputProps,
  Modal,
  ModalBody,
  ModalCloseButton,
  ModalContent,
  ModalHeader,
  ModalOverlay,
  Select,
} from '@chakra-ui/react';
import {
  Field,
  Form,
  Formik,
  FormikErrors,
  FormikHelpers,
  FormikProps,
  useFormikContext,
} from 'formik';
import { FieldInputProps } from 'formik/dist/types';

import {
  fieldTypesArray,
  ICheckboxField,
  IDatepicker,
  IFormValues,
  IHiddenField,
  IInputField,
  ISelectField,
  TInputField,
  TInputFields,
} from '@interfaces/admin-modal-form.intefaces';
import { AdminDatepicker } from 'src/common/AdminDatepicker';
import { prepareAdminModalFormFieldUtils } from '@utils/prepare-admin-modal-form-field.utils';

import classes from './AdminModalForm.module.scss';

const isInput = (object: { type: string }): object is IInputField =>
  fieldTypesArray.some((type) => object.type === type);

const isHiddenInput = (object: { type: string }): object is IHiddenField =>
  object.type === 'hidden';

const isSelect = (object: { type: string }): object is ISelectField =>
  object.type === 'select';

const isDatepicker = (object: { type: string }): object is IDatepicker =>
  object.type === 'datepicker';

const isCheckbox = (object: { type: string }): object is ICheckboxField =>
  object.type === 'checkbox';

interface Props {
  header: string;
  isOpen: boolean;
  inputs: TInputField[] | TInputFields;
  // eslint-disable-next-line react/require-default-props
  submitButton?: React.ReactNode;
  onChange: (
    values: IFormValues<TInputField[]>,
    setValue: (
      field: string,
      value: string | number,
      shouldValidate?: boolean | undefined
    ) => Promise<void | FormikErrors<IFormValues<TInputField[]>>>
  ) => void;
  submitHandler: (
    values: IFormValues<TInputField[]>,
    actions: FormikHelpers<IFormValues<TInputField[]>>
  ) => void;
  onClose: () => void;
}

const FormObserver = ({
  onChange,
}: {
  onChange: (
    values: IFormValues<TInputField[]>,
    setValue: (
      field: string,
      value: string | number,
      shouldValidate?: boolean | undefined
    ) => Promise<void | FormikErrors<IFormValues<TInputField[]>>>
  ) => void;
}) => {
  const { values, setFieldValue } =
    useFormikContext<IFormValues<TInputField[]>>();
  const oldValues = useRef<IFormValues<TInputField[]>>();

  useEffect(() => {
    if (
      onChange &&
      JSON.stringify(oldValues.current) !== JSON.stringify(values)
    ) {
      oldValues.current = values;
      onChange(values, setFieldValue);
    }
  }, [values, onChange, setFieldValue]);

  return null;
};

const AdminModalForm = ({
  header,
  isOpen,
  onClose,
  inputs,
  submitHandler,
  onChange,
  submitButton,
}: Props) => {
  const inputFields = useMemo(
    () => prepareAdminModalFormFieldUtils(inputs),
    [inputs]
  );

  const defaultValues: IFormValues<typeof inputFields> = inputFields.reduce(
    (acc, currentInput) => ({
      ...acc,
      [currentInput.name]: currentInput.value,
    }),
    {}
  );

  return (
    <Modal isOpen={isOpen} onClose={onClose}>
      <ModalOverlay />
      <ModalContent
        className={classes['admin-modal']}
        data-testid="admin-modal"
      >
        <ModalHeader>{header}</ModalHeader>
        <ModalCloseButton />
        <ModalBody>
          <Formik initialValues={defaultValues} onSubmit={submitHandler}>
            {(formikProps: FormikProps<IFormValues<TInputField[]>>) => (
              <Form>
                <FormObserver onChange={onChange} />
                {inputFields.map((inputField) => (
                  <Field
                    key={inputField.name}
                    name={inputField.name}
                    validate={inputField.validate}
                  >
                    {({
                      field,
                      form,
                    }: {
                      field: FieldInputProps<typeof inputField.value>;
                      form: FormikProps<IFormValues<typeof inputFields>>;
                    }) => (
                      <FormControl
                        isInvalid={
                          (form.errors[inputField.name] &&
                            form.touched[inputField.name]) as boolean
                        }
                        flexDir={isCheckbox(inputField) ? 'column' : 'row'}
                      >
                        {isHiddenInput(inputField) ? (
                          <Input {...(field as InputProps)} type="hidden" />
                        ) : (
                          // eslint-disable-next-line react/jsx-no-useless-fragment
                          <>
                            {isCheckbox(inputField) ? (
                              <Checkbox
                                {...field}
                                value=""
                                defaultChecked={inputField.value}
                              >
                                {inputField.label}
                              </Checkbox>
                            ) : (
                              <>
                                <FormLabel>{inputField.label}</FormLabel>
                                {isInput(inputField) && (
                                  <Input
                                    {...(field as FieldInputProps<
                                      string | number | undefined
                                    >)}
                                    type={inputField.type}
                                    disabled={inputField.disabled}
                                    placeholder={inputField.placeholder}
                                    className={classes['input-field']}
                                  />
                                )}
                                {isSelect(inputField) && (
                                  <Select
                                    {...(field as FieldInputProps<
                                      string | number | undefined
                                    >)}
                                    disabled={inputField.disabled}
                                    placeholder={inputField.placeholder}
                                    className={classes['input-field']}
                                  >
                                    {inputField.options.map((option) => (
                                      <option
                                        key={option.value}
                                        value={option.value}
                                      >
                                        {option.name ?? option.value}
                                      </option>
                                    ))}
                                  </Select>
                                )}
                                {isDatepicker(inputField) && (
                                  <AdminDatepicker
                                    {...(field as FieldInputProps<Date>)}
                                    // eslint-disable-next-line @typescript-eslint/ban-ts-comment
                                    // @ts-ignore
                                    selected={Date.parse(field.value)}
                                    disabled={inputField.disabled}
                                    activeDates={inputField.activeDates}
                                    className={[
                                      classes['input-field'],
                                      classes['datepicker-field'],
                                    ].join(' ')}
                                    wrapperClassName={classes.datepicker}
                                  />
                                )}
                                <FormErrorMessage>
                                  {form.errors[inputField.name]}
                                </FormErrorMessage>
                              </>
                            )}
                          </>
                        )}
                      </FormControl>
                    )}
                  </Field>
                ))}
                <div className={classes.controls}>
                  <Button
                    data-testid="admin-modal-submit"
                    mt={4}
                    backgroundColor="#006fff"
                    color="#fff"
                    borderRadius=".25rem"
                    width="12.5rem"
                    isLoading={formikProps.isSubmitting}
                    type="submit"
                  >
                    {submitButton ?? 'Send'}
                  </Button>
                  <Button
                    data-testid="admin-modal-cancel"
                    mt={4}
                    borderRadius=".25rem"
                    width="12.5rem"
                    colorScheme="white"
                    color="black"
                    border="1px solid #a3a3a3"
                    isLoading={formikProps.isSubmitting}
                    onClick={onClose}
                  >
                    Отмена
                  </Button>
                </div>
              </Form>
            )}
          </Formik>
        </ModalBody>
      </ModalContent>
    </Modal>
  );
};
export default AdminModalForm;

export const fieldTypesArray = [
  'text',
  'email',
  'password',
  'tel',
  'number',
] as const;

type IInput = (typeof fieldTypesArray)[number];

interface IField<T> {
  name: string;
  label?: string;
  placeholder?: string;
  disabled?: boolean;
  value?: T;
  validate?: (value: T) => string | undefined;
}

export interface IHiddenField extends IField<string> {
  type: 'hidden';
  label: undefined;
}

export interface IInputField extends IField<string> {
  type: IInput;
}

export interface ICheckboxField extends IField<boolean> {
  type: 'checkbox';
}

export interface IOption {
  value: string | number;
  name: string;
}

export interface ISelectField extends IField<string | number> {
  type: 'select';
  options: IOption[];
}

export interface IDatepicker extends IField<string | Date> {
  type: 'datepicker';
  activeDates?: Date[];
}

export type TInputField =
  | ISelectField
  | IInputField
  | IHiddenField
  | ICheckboxField
  | IDatepicker;

export type IFormValues<T extends TInputField[]> = {
  [K in T[number]['name']]: T[number]['type'] extends 'checkbox' | 'radio'
    ? boolean
    : string;
};

export type TInputFields = {
  [key: string]: Omit<TInputField, 'name'> & {
    name?: string;
    options?: IOption[];
    activeDates?: Date[];
  };
};

import { Button, Flex, Spinner, Text, useDisclosure } from '@chakra-ui/react';
import { useEffect, useState } from 'react';
import { FormikErrors } from 'formik';
 
import { Plus } from '@icons/index';
import { BookingTable } from '@components/BookingTable';
import { Pagination } from '@common/Pagination';
import { useAppDispatch, useAppSelector } from '@/hooks';
import {
  createAdminBooking,
  deleteAdminBookingItemById,
  editAdminBooking,
  fetchAdminBookingList,
  fetchDestinationsForBooking,
  fetchFlightsListForBooking,
  fetchPassengersForBooking,
} from '@/store/thunks/booking-admin.thunk';
import { bookingAdminSlice } from '@/store/booking-admin.slice';
import { AdminModalForm } from '@common/AdminModalForm';
import {
  IFormValues,
  TInputField,
  TInputFields,
} from '@interfaces/admin-modal-form.intefaces';
import { ModalRemove } from '@/components/ModalRemove';
import { useMessageAlert } from '@/hooks/useMessageAlert';
import { TicketCategory } from '@enums/ticket-category';
import {
  IAdminBooking,
  TAdminBookingForm,
} from '@interfaces/admin-booking.interfaces';
import { BookingService } from '@services/booking.service';
import { FlightsAdminApi } from '@services/flights.services';
import { IFlightContent } from '@interfaces/search-form.interfaces';
 
const initialInputs: TInputFields = {
  flightKey: {
    type: 'text',
    label: 'Код (рейс)',
    disabled: true,
    value: '',
  },
  arrivalCity: {
    type: 'hidden',
    value: '',
  },
  destinationCity: {
    type: 'hidden',
    value: '',
  },
  arrivalPort: {
    type: 'select',
    placeholder: 'Выбирете город отбытия',
    label: 'Город отбытия',
    options: [],
    validate: (value: string) => {
      if (!value?.length) {
        return 'Не выбран город отправления';
      }
    },
  },
  destinationPort: {
    type: 'select',
    placeholder: 'Выбирете город прибытия',
    label: 'Город прибытия',
    options: [],
    validate: (value: string) => {
      if (!value?.length) {
        return 'Не выбран город прибытия';
      }
    },
  },
  arrivalDate: {
    type: 'datepicker',
    label: 'Дата отбытия',
    activeDates: [],
    disabled: true,
    validate: (value: string | Date) => {
      if (!(value instanceof Date)) {
        return 'Не выбрана дата отправления';
      }
    },
  },
  flightId: {
    type: 'select',
    label: 'Время отбытия',
    options: [],
    disabled: true,
    placeholder: 'Выберите время отлета',
    validate: (value: string | number) => {
      if (!value) {
        return 'Не выбрано время отправления';
      }
    },
  },
  passengerId: {
    type: 'select',
    label: 'Пассажир',
    placeholder: 'Выбирите пассажира',
    options: [],
    validate: (value: string | number) => {
      if (!value) {
        return 'Не выбран пассажир';
      }
    },
  },
  categoryType: {
    type: 'select',
    placeholder: 'Выберите категорию билета',
    label: 'Категория',
    options: Object.entries(TicketCategory).map((cat) => ({
      value: cat[0],
      name: cat[0],
    })),
    validate: (value: string) => {
      if (!value?.length) {
        return 'Не выбрана категория билета';
      }
    },
  },
};
 
const BookingPage = () => {
  const dispatch = useAppDispatch();
 
  const { page, totalPages, isLoading, destinations, passengers, flights } =
    useAppSelector((state) => state.booking);
 
  const [inputs, setInputs] = useState<TInputFields>(initialInputs);
  const modalForm = useDisclosure();
  const contextMenu = useDisclosure();
  const [itemForDelete, setItemForDelete] = useState(0);
  const { messageApi, MessageAlertContainer } = useMessageAlert();
  const [editId, setEditId] = useState(0);
 
  const formChange = (
    values: IFormValues<TInputField[]>,
    setFieldValue: (
      field: string,
      value: string | number,
      shouldValidate?: boolean | undefined
    ) => Promise<void | FormikErrors<IFormValues<TInputField[]>>>
  ) => {
    if (values.arrivalPort) {
      const arrivalCity =
        destinations.destinations.find(
          (destination) => destination.airportCode === values.arrivalPort
        )?.cityName ?? '';
      if (arrivalCity !== values.arrivalCity) {
        setFieldValue('arrivalCity', arrivalCity).catch((e) =>
          messageApi.error((e as Error).message)
        );
      }
    }
 
    if (values.destinationPort) {
      const destinationCity =
        destinations.destinations.find(
          (destination) => destination.airportCode === values.destinationPort
        )?.cityName ?? '';
      if (destinationCity !== values.destinationCity) {
        setFieldValue('destinationCity', destinationCity).catch((e) =>
          messageApi.error((e as Error).message)
        );
      }
    }
 
    if (values.arrivalPort && values.destinationPort) {
      const flightKey = values.arrivalPort + values.destinationPort;
      if (values.flightKey !== flightKey) {
        dispatch(bookingAdminSlice.actions.resetStateKey('flights'));
        setFieldValue('arrivalDate', '').catch((e) => {
          messageApi.error((e as Error).message);
        });
        setFieldValue('flightId', '').catch((e) => {
          messageApi.error((e as Error).message);
        });
        setFieldValue('flightKey', flightKey).catch((e) =>
          messageApi.error((e as Error).message)
        );
      }
    }
 
    if (
      values.arrivalCity &&
      values.destinationCity &&
      !flights.flights.length
    ) {
      dispatch(
        fetchFlightsListForBooking({
          cityFrom: values.arrivalCity,
          cityTo: values.destinationCity,
          page: 0,
        })
      ).catch((e) => messageApi.error((e as Error).message));
    }
 
    if (values.arrivalDate) {
      const flOptions = flights.flights
        .filter(
          (flight) =>
            new Date(flight.arrivalDateTime).toDateString() ===
            new Date(values.arrivalDate).toDateString()
        )
        .map((flight) => ({
          value: flight.id,
          name: new Date(flight.arrivalDateTime).toLocaleTimeString(),
        }));
 
      setInputs((prevState) => ({
        ...prevState,
        flightId: {
          ...prevState.flightId,
          disabled: false,
          options: flOptions,
        },
      }));
    }
  };
 
  useEffect(() => {
    dispatch(fetchAdminBookingList(page)).catch((err: Error) =>
      messageApi.error(err.name)
    );
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, [dispatch, page]);
 
  useEffect(() => {
    if (
      destinations.page === -1 ||
      destinations.page + 1 < destinations.totalPages
    ) {
      dispatch(fetchDestinationsForBooking(destinations.page + 1))
        .then((r) => r)
        .catch((e: Error) => messageApi.error(e.message));
    }
 
    if (destinations.destinations.length) {
      setInputs((prevState) => ({
        ...prevState,
        arrivalPort: {
          ...prevState.arrivalPort,
          options: destinations.destinations.map((destination) => ({
            value: destination.airportCode,
            name: destination.cityName,
          })),
        },
        destinationPort: {
          ...prevState.destinationPort,
          options: destinations.destinations.map((destination) => ({
            value: destination.airportCode,
            name: destination.cityName,
          })),
        },
      }));
    }
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, [destinations, dispatch]);
 
  useEffect(() => {
    if (passengers.page === -1 || passengers.page + 1 < passengers.totalPages) {
      dispatch(fetchPassengersForBooking(passengers.page + 1)).catch(
        (e: Error) => messageApi.error(e.message)
      );
    }
 
    if (passengers.passengers.length) {
      setInputs((prevState) => ({
        ...prevState,
        passengerId: {
          ...prevState.passengerId,
          options: passengers.passengers.map((passenger) => ({
            value: passenger.id,
            name: `${passenger.firstName} ${passenger.lastName}`,
          })),
        },
      }));
    }
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, [dispatch, passengers]);
 
  useEffect(() => {
    if (flights.page + 1 < flights.totalPages) {
      dispatch(
        fetchFlightsListForBooking({
          cityFrom: inputs.arrivalCity.value as string,
          cityTo: inputs.destinationCity.value as string,
          page: flights.page + 1,
        })
      ).catch((e: Error) => messageApi.error(e.message));
    }
 
    if (flights.flights.length) {
      setInputs((prevState) => {
        const flightId = {
          ...prevState.flightId,
        };
        if (flightId.value) {
          flightId.options = flights.flights
            .filter(
              (flight) =>
                new Date(flight.arrivalDateTime).toDateString() ===
                new Date(prevState.arrivalDate.value as string).toDateString()
            )
            .map((flight) => ({
              value: flight.id,
              name: new Date(flight.arrivalDateTime).toLocaleTimeString(),
            }));
        }
 
        return {
          ...prevState,
          arrivalDate: {
            ...prevState.arrivalDate,
            disabled: false,
            activeDates: flights.flights.map(
              (flight) => new Date(flight.arrivalDateTime)
            ),
          },
          flightId,
        };
      });
    }
 
    if (!flights.flights.length) {
      setInputs((prevState) => ({
        ...prevState,
        flightId: {
          ...prevState.flightId,
          value: '',
          options: [],
          disabled: true,
        },
        arrivalDate: {
          ...prevState.arrivalDate,
          value: '',
          disabled: true,
        },
      }));
    }
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, [flights, dispatch]);
 
  const onDeleteBookingItem = (id: number) => {
    contextMenu.onOpen();
    setItemForDelete(id);
  };
 
  const deleteBooking = async (id: number) => {
    await dispatch(deleteAdminBookingItemById(id))
      .then(() => dispatch(fetchAdminBookingList(page)))
      .catch((e: Error) => messageApi.error(e.name));
  };
 
  const onEditBooking = (id: number) => {
    BookingService.fetchBookingById(id)
      .then((r) => {
        const booking = r.data as IAdminBooking;
 
        FlightsAdminApi.getFlightById(booking.flightId)
          .then((result) => {
            const flight = result.data as IFlightContent;
 
            const airportFrom = destinations.destinations.find(
              (destination) => destination.airportCode === flight.airportFrom
            );
 
            const airportTo = destinations.destinations.find(
              (destination) => destination.airportCode === flight.airportTo
            );
 
            setInputs((prevState) => ({
              ...prevState,
              flightKey: {
                ...prevState.flightKey,
                value: `${airportFrom?.airportCode ?? ''}${
                  airportTo?.airportCode ?? ''
                }`,
              },
              arrivalCity: {
                ...prevState.arrivalCity,
                value: airportFrom?.cityName ?? '',
              },
              destinationCity: {
                ...prevState.destinationCity,
                value: airportTo?.cityName ?? '',
              },
              arrivalPort: {
                ...prevState.arrivalPort,
                value: airportFrom?.airportCode ?? '',
              },
              destinationPort: {
                ...prevState.destinationPort,
                value: airportTo?.airportCode ?? '',
              },
              arrivalDate: {
                ...prevState.arrivalDate,
                disabled: false,
                value: new Date(Date.parse(flight.arrivalDateTime)),
              },
              passengerId: {
                ...prevState.passengerId,
                value: booking.passengerId,
              },
              categoryType: {
                ...prevState.categoryType,
                value: booking.categoryType,
              },
              flightId: {
                ...prevState.flightId,
                value: booking.flightId,
              },
            }));
            setEditId(id);
            modalForm.onOpen();
          })
          .catch((e) => {
            throw e;
          });
      })
      .catch((e: Error) => messageApi.error(e.message));
  };
 
  return (
    <Flex p="3.125rem" direction="column">
      {MessageAlertContainer}
      <Flex justifyContent="space-between" alignItems="center">
        <Text fontSize="1.25rem" fontWeight="600">
          Бронирование
        </Text>
        <Button onClick={modalForm.onOpen} data-testid="booking-modal-open">
          Забронировать
          <Plus ml="0.5rem" />
        </Button>
      </Flex>
      {isLoading ? (
        <Spinner
          thickness="4px"
          speed="0.65s"
          emptyColor="gray.200"
          color="blue.500"
          size="xl"
        />
      ) : (
        <>
          <BookingTable
            onDeleteItem={onDeleteBookingItem}
            onEditItem={onEditBooking}
          />
          {totalPages > 1 && (
            <Pagination
              handlePageClick={(p) =>
                dispatch(bookingAdminSlice.actions.setPage(p.selected))
              }
              initialPage={page}
              pageCount={totalPages}
            />
          )}
          <ModalRemove
            isOpen={contextMenu.isOpen}
            onClose={contextMenu.onClose}
            onDelete={deleteBooking}
            textBody="Вы действительно ходите удалить бронирование?"
            itemOnDelete={itemForDelete}
          />
        </>
      )}
      <AdminModalForm
        header="Забронировать"
        isOpen={modalForm.isOpen}
        inputs={inputs}
        onChange={formChange}
        submitHandler={(data, actions) => {
          const formData: TAdminBookingForm = {
            bookingData:
              flights.flights?.find(
                (flight) => flight.id === parseInt(data.flightId, 10)
              )?.arrivalDateTime || '',
            bookingNumber: '012345678',
            categoryType: TicketCategory.BUSINESS,
            flightId: parseInt(data.flightId, 10),
            passengerId: parseInt(data.passengerId, 10),
          };
 
          if (!editId) {
            dispatch(createAdminBooking(formData))
              .then((r) => {
                if (r.meta.requestStatus !== 'rejected') {
                  messageApi.success('Бронь успешно создана');
                  dispatch(bookingAdminSlice.actions.resetStateKey('page'));
                  modalForm.onClose();
                } else {
                  throw new Error((r.payload as Error).message);
                }
              })
              .catch((e: Error) => messageApi.error(e.message))
              .finally(() => {
                actions.setSubmitting(false);
              });
          }
          if (editId) {
            dispatch(editAdminBooking({ ...formData, id: editId }))
              .then((r) => {
                if (r.meta.requestStatus !== 'rejected') {
                  messageApi.success('Бронь успешно отредактированна');
                  dispatch(bookingAdminSlice.actions.resetStateKey('page'));
                  setEditId(0);
                  modalForm.onClose();
                } else {
                  throw new Error((r.payload as Error).message);
                }
              })
              .catch((e: Error) => messageApi.error(e.message))
              .finally(() => {
                actions.setSubmitting(false);
              });
          }
        }}
        onClose={() => {
          setInputs((prevState) => ({
            ...initialInputs,
            arrivalPort: {
              ...initialInputs.arrivalPort,
              options: prevState.arrivalPort.options,
            },
            destinationPort: {
              ...initialInputs.destinationPort,
              options: prevState.destinationPort.options,
            },
            passengerId: {
              ...initialInputs.passengerId,
              options: prevState.passengerId.options,
            },
          }));
          setEditId(0);
          modalForm.onClose();
        }}
        submitButton={
          <>
            <p>Забронировать</p>
            <Plus />
          </>
        }
      />
    </Flex>
  );
};
 
export default BookingPage;

